    const [cards, setCards] = useState([]);
    const [isLoading, setIsLoading] = useState(false)

    useEffect(() => {
        setIsLoading(true)
        getCards();
        console.log(cards)

    }, [])

    const getCards = async () => {
        const setCardArry = (crdArry) => {
            console.log(crdArry)
            setCards(crdArry);

        }
        const cardArry = await getLegend()
        setCardArry(cardArry);
        setIsLoading(false)
    }

  return (
    <div>
        {
            isLoading &&
            <p className='text-input'>Loading...</p>
        }
        {
            cards &&
            cards.map(card => {
                <div className="practice-container">
                    <PracticeCard queue={card.queue} />
                </div>
            })
        }
    </div>
  );
}

export default Practice;
